import React, { useState } from "react";
import "./assets/Login.css";

export default function Login(props) {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  function validateForm() {
    return email.length > 0 && password.length > 0;
  }

  function handleSubmit(event) {
    event.preventDefault();
  }

  return (
    <div className="Login">
      <form onSubmit={handleSubmit}>
        <div className="email">
          <label htmlFor="exampleInputEmail1">Email address</label>
          <input name="email" value={this.state.email} onChange={e => setEmail(e.target.value)} type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" />
          </div>
          <div className="password">
          <label htmlFor="exampleInputPassword1">Password</label>
          <input name="display_name" type="password" value={this.state.password} onChange={e => setPassword(e.target.value)}  className="form-control" id="exampleInputPassword1" placeholder="Password" />
          </div>
          <div className="createAccount">
            <button type="submit" disabled={!validateForm()} className="btn btn-primary">Submit</button>
          </div>
      </form>
    </div>
  );
}
